package io.quicktype;

public class Details {
    private double amount;
    private Double availabletobet;
    private Double bonus;
    private Double bonuses;
    private Double deposits;
    private Double real;
    private Double winnings;

    public double getAmount() { return amount; }
    public void setAmount(double value) { this.amount = value; }

    public Double getAvailabletobet() { return availabletobet; }
    public void setAvailabletobet(Double value) { this.availabletobet = value; }

    public Double getBonus() { return bonus; }
    public void setBonus(Double value) { this.bonus = value; }

    public Double getBonuses() { return bonuses; }
    public void setBonuses(Double value) { this.bonuses = value; }

    public Double getDeposits() { return deposits; }
    public void setDeposits(Double value) { this.deposits = value; }

    public Double getReal() { return real; }
    public void setReal(Double value) { this.real = value; }

    public Double getWinnings() { return winnings; }
    public void setWinnings(Double value) { this.winnings = value; }
}
